import React from "react";
import { Button, View } from "react-native";

// const goToNextPage = () => {
//   () => navigation.navigate("CheckInBags");
// };

const NavigationButton = ({ navigation }) => {
  <View>
    <Button
      title={"Bags"}
      color="#244D9D"
      onPress={() => navigation.navigate("CheckInBags")}
    />
    ;
  </View>;
};

export default NavigationButton;
